import React from 'react';
import { Layout } from './components/Layout';
import Column from 'react-bootstrap/Column';
export const Inicio = () => (
    <Layout>
        <Column>
            <h1 className="text-center">BIENVENIDO A TU</h1>
            <h1 className="text-center">PLATAFORMA ESTUDIANTIL</h1>
        </Column>
    </Layout>
)
